// src/router.js
import { createRouter, createWebHistory } from 'vue-router';
import AppSnake from './views/AppSnake.vue';

Vue.use(Router);

export default new Router({
    mode: 'history',
    routes: [
    {
      path: '/snake',
      component: AppSnake
    },
  ]
});
